import ArticlesList from "./ArticlesListPage";

const articles = [
    {
        name: 'learn-react',
        title: 'The best way to learn React',
        content: [
            'This is an article about how you can learn React the best and easiest way., React is an amazing JavaScript framework., You need loads of practise despite being an "easy" technology to learn!'
        ]
    }
]

export default articles;
